import React, { Component } from 'react';
import {Environment} from '../components/environment/index';
import axios from 'axios';
import { If, Then, Else, Switch, Case} from 'react-if';

class BestSellingProduct extends Component {

    constructor (props){
        super(props);

        this.state = {
            bestSellingList: [],
        }

        axios.get(Environment.apiurl+'bestSellingProductList')
            .then(result => {
                if(result){
                    this.setState({bestSellingList: result.data.response});
                }
            });
    }

    render(){
        return (
            <div>
                <section class="products">
                    <div class="container">
                        <h2>Best Selling Products</h2>
                        <div id="products2" class="owl-carousel owl-theme">

                            <div class="item">
                                <div class="itemBox">
                                    <figure>
                                        <a href="#"><img src={Environment.apiurl+"/images/product1.jpg"} class="img-fluid" /></a>
                                    </figure>
                                    <div class="addCart"> 
                                        <a href="#" class="wishList"><i class="fas fa-heart"></i></a>
                                        <button>Add to cart</button>
                                        <a href="#" class="comPare"><i class="fas fa-info-circle"></i></a> 
                                    </div>
                                    <h3><a href="#">Chuck cupim spare</a></h3>
                                    <div class="prPrice">$76.00</div>
                                </div>
                            </div>
                        </div>


                    </div>
                </section>
            </div>
        )
    }
}

export default BestSellingProduct;
